import React from 'react';
import {
  Routes,
  Route,
} from 'react-router-dom';



import Home from './pages/Home';
import SignIn from './pages/SignIn';
import SignUp from './pages/SignUp';
import Ride from './pages/Ride';
import Drive from './pages/Drive';
import Login from './pages/Login';
import Signup from './pages/Driver/Signup';
import Annonces from './pages/Driver/Annonces';
import Dashboard from './pages/Driver/Dashboard';

function App() {


  return (
    <>
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/driver" element={<Dashboard />} />
        <Route exact path="/driver/signup" element={<Signup />} />

        <Route exact path="/admin" element={<Home />} />
        <Route exact path="/admin/login" element={<Home/>} />

        <Route exact path="/login" element={<Login />} />
        <Route path="/ride" element={<Ride />} />
        <Route path="/drive" element={<Drive />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<SignUp />} />
      </Routes>
    </>
  );
}

export default App;
